import React from 'react';
// import './App.css';

class Navigation extends React.Component {
    render(){
        return (
            <nav>
               <h2> React Project</h2>
               <ul>
                   <li>Home</li>
                   <li>About</li>
                   <li>Contact</li>
               </ul>
            </nav>

        );

    }

}

export default Navigation;
